        catch
        {
            IsValid = false;
        }
    }

    async Task Reload()
    {
        Seats = await Http.GetFromJsonAsync<List<Seat>>("https://localhost:7297/api/Seats");
        await GridSeat.Reload();
    }

    void fillData(Seat seat)
