    private void ExportarCSV()
    {
        CsvData.Clear();
        foreach (var i in Seats)
        {
                CsvData.Add(i);
        }

            using (var memoryStream = new MemoryStream())
            {
                using (var writer = new StreamWriter(memoryStream))
